import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from './ui/card';
import { Button } from './ui/button';
import { Input } from './ui/input';
import { Loader2 } from 'lucide-react';
import { Alert, AlertDescription } from './ui/alert';
import { Language } from '../types/Language';

const ExcelAutomationForm = () => {
    const [formData, setFormData] = useState({
        version: '',
        filePathUrl: '',
        destination_filePathUrl: '',
        languages: [] // Start with empty array
    });

    const [loading, setLoading] = useState(false);
    const [message, setMessage] = useState('');
    const [error, setError] = useState('');

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleLanguageToggle = (language) => {
        setFormData(prev => ({
            ...prev,
            languages: prev.languages.includes(language)
                ? prev.languages.filter(lang => lang !== language)
                : [...prev.languages, language]
        }));
    };

    const transformLanguageForBackend = (language) => {
        // This will transform the display name to the format backend expects
        const languageMap = {
            [Language.ENGLISH]: 'ENGLISH',
            [Language.FRENCH]: 'FRENCH',
            [Language.ITALIAN]: 'ITALIAN',
            [Language.RUSSIAN]: 'RUSSIAN',
            [Language.JAPANESE]: 'JAPANESE',
            [Language.CHINESE_SIMPLIFIED]: 'CHINESE_SIMPLIFIED',
            [Language.CHINESE_TRADITIONAL]: 'CHINESE_TRADITIONAL',
            [Language.ARABIC]: 'ARABIC'
        };
        return languageMap[language];
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setMessage('');
        setError('');

        // Transform the data for the backend
        const backendData = {
            ...formData,
            languages: formData.languages.map(transformLanguageForBackend)
        };

        try {
            const response = await fetch('http://localhost:8080/excel/automate', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(backendData)
            });

            if (!response.ok) {
                throw new Error('Failed to process the request');
            }

            const data = await response.text();
            setMessage(data);
        } catch (err) {
            setError(err.message);
        } finally {
            setLoading(false);
        }
    };

    const allLanguages = Object.values(Language);

    return (
        <div className="container mx-auto p-4 max-w-2xl">
            <Card>
                <CardHeader>
                    <CardTitle>Excel Automation Form</CardTitle>
                </CardHeader>
                <CardContent>
                    <form onSubmit={handleSubmit} className="space-y-4">
                        <div>
                            <label className="block text-sm font-medium mb-1">Version</label>
                            <Input
                                name="version"
                                value={formData.version}
                                onChange={handleInputChange}
                                placeholder="e.g., V3_01_17_01"
                                required
                            />
                        </div>

                        <div>
                            <label className="block text-sm font-medium mb-1">File Path URL</label>
                            <Input
                                name="filePathUrl"
                                value={formData.filePathUrl}
                                onChange={handleInputChange}
                                placeholder="C:\Path\To\File.xlsm"
                                required
                            />
                        </div>

                        <div>
                            <label className="block text-sm font-medium mb-1">Destination Path URL</label>
                            <Input
                                name="destination_filePathUrl"
                                value={formData.destination_filePathUrl}
                                onChange={handleInputChange}
                                placeholder="C:\Destination\Path\"
                                required
                            />
                        </div>

                        <div>
                            <label className="block text-sm font-medium mb-2">Languages</label>
                            <div className="grid grid-cols-2 gap-2">
                                {allLanguages.map(language => (
                                    <label key={language} className="flex items-center space-x-2">
                                        <input
                                            type="checkbox"
                                            checked={formData.languages.includes(language)}
                                            onChange={() => handleLanguageToggle(language)}
                                            className="rounded border-gray-300"
                                        />
                                        <span className="text-sm">{language}</span>
                                    </label>
                                ))}
                            </div>
                        </div>

                        <Button
                            type="submit"
                            className="w-full"
                            disabled={loading}
                        >
                            {loading ? (
                                <>
                                    <Loader2 className="mr-2 h-4 w-4 animate-spin" />
                                    Processing...
                                </>
                            ) : 'Submit'}
                        </Button>

                        {message && (
                            <Alert className="mt-4 bg-green-50">
                                <AlertDescription>{message}</AlertDescription>
                            </Alert>
                        )}

                        {error && (
                            <Alert className="mt-4 bg-red-50">
                                <AlertDescription className="text-red-600">{error}</AlertDescription>
                            </Alert>
                        )}
                    </form>
                </CardContent>
            </Card>
        </div>
    );
};

export default ExcelAutomationForm;
